import React from "react";

export function SearchResults({ results, searchTerm }) {
  return (
    <div className="search-results">
      <h4>Search Results for "{searchTerm}"</h4>
      <ul>
        {results.map((result) => (
          <li key={result.id}>{result.title}</li>
        ))}
      </ul>
    </div>
  );
}
